import React, { Component } from "react";
import "./App.css";
import logo from "./assets/images/ssfulllogo.png";
import headerimg from "./assets/images/headerSMl.png";
import { Col, Row, Container, Navbar, InputGroup, FormControl  } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

class App extends Component {
  render() {
    return (
      <>
        <Navbar bg="light navbar-light">
          <Navbar.Brand href="/">
            <img
              src={logo}
              width="150"
              height="30"
              className="d-inline-block align-top"
              alt="SAVESTANCE"
            />
          </Navbar.Brand>
        </Navbar>

        <Container>
          <Row>
            <Col>
              <div>
                <InputGroup size="sm" className="mb-3">
                  <InputGroup.Append>Store</InputGroup.Append>
                  <FormControl
                    aria-label="Small"
                    aria-describedby="inputGroup-sizing-sm"
                  />
                </InputGroup>
              </div>
            </Col>
            <Col xs={9}>
              <img src={headerimg} width="100%" alt="decoration"></img>
            </Col>
            <Col>2 of 2</Col>
          </Row>
          <Row>
            <Col>2 of 3</Col>
            <Col>3 of 3</Col>
          </Row>
        </Container>
      </>
    );
  }
}

export default App;
